import { memo } from "react";
import "./style.scss";
import { AiOutlineAccountBook, AiOutlineFacebook, AiOutlineInstagram, AiOutlineLink, AiOutlineTwitter, AiOutlineUser } from "react-icons/ai";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header_top">
      <div className="container">
        <div className="row">
          <div className="col-6">Left</div>
          <div className="col-6 header_top_right">
            <ul>
              <li><Link to={""}><AiOutlineFacebook/></Link></li>
              <li><AiOutlineInstagram/></li>
              <li><AiOutlineLink/></li>
              <li><AiOutlineTwitter/></li>
              <li>
                <Link to={""}>
                  <AiOutlineUser/>
                </Link>
                <span>Đăng nhập</span>
              </li>
              <li>
                <Link to={""}>
                  <AiOutlineUser/>
                </Link>
                <span>Đăng ký</span>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default memo(Header);
